import axios from "axios";

export const suggestFunction = async() => {
    const url  = "http://suggestions.dadata.ru/suggestions/api/4_1/rs/suggest/address";
    const token = '5e402b86a708e261e916f1f65c9d38bbb3c0ff7e';
    const query = 'ул Туркестан 28/2';
    const city = 'Астана';
    const options = {
        method: 'POST',
        mode: 'cors',
        headers: {
            'Content-Type': 'application/json',
            Accept: 'application/json',
            Authorization: 'Token ' + token,
        },
        body: JSON.stringify({
            query: query,
            locations: [
                {
                    city: city,
                    country: '*',
                },
            ],
        }),
    };

    const result = await axios(url, options)
    console.log(result.data)
}
